import { View, Image, StyleSheet, ImageBackground, Text, ScrollView, TouchableOpacity, TextInput } from 'react-native'
import React, { useState, useRef } from 'react'
import { BlurView } from 'expo-blur';
import { Ionicons, Octicons, FontAwesome, AntDesign } from '@expo/vector-icons';
import { Calendar, CalendarList, Agenda } from 'react-native-calendars';
import RBSheet from "react-native-raw-bottom-sheet";

export default function Index({ navigation }) {
  const filterRef = useRef();
  const arr = [1, 2, 3, 4, 5, 6, 7]
  const [listView, setListView] = useState(false);
  const currentDate = new Date().toISOString().slice(0, 10);
  return (
    <View style={styles.container}>
      <View style={styles.background}>
        <ScrollView showsVerticalScrollIndicator={false}>
          <View style={styles.contentContainer}>
            <View style={styles.topBarContainer}>
              <View>
                <Text style={styles.totalAmount}>Total $11,500</Text>
              </View>
              <View>
                <TouchableOpacity style={styles.filterBtn} onPress={() => filterRef.current.open()}>
                  <Text style={styles.filterBtnText}>Filter</Text>
                </TouchableOpacity>
              </View>
            </View>
            <View style={styles.eventSearchBar}>
              <View>
                <AntDesign name="search1" size={24} color="#797979" />
              </View>
              <View>
                <TextInput maxLength={35} placeholder='Search events, dates, and more' placeholderTextColor={"#000"} style={styles.input} />
              </View>
            </View>
          </View>
          {
            listView == false ?
              <View>
                <View>
                  <Text style={styles.calanderTitle}>View events for</Text>
                </View>

                <View>
                  <Calendar
                    style={{
                      height: 310,
                    }}
                    theme={{
                      textSectionTitleDisabledColor: '#fff',
                      calendarBackground: "#ED8524",
                      backgroundColor: "#ED8524",
                      textDayStyle: {
                        textAlign: 'center',
                        marginTop: 13,
                        color: "#fff",
                        fontSize: 17
                      },
                    }}
                    markingType={'custom'}
                    markedDates={{
                      [currentDate]: {
                        customStyles: {
                          container: {
                            backgroundColor: '#D92B50',
                            width: 50,
                            height: 50,
                            borderRadius: 8
                          },
                          text: {
                            color: 'white',
                            fontWeight: 'bold',
                          }
                        },
                        marked: true, dotColor: '#fff'
                      },
                      // '2022-06-16': { marked: true, dotColor: '#50cebb' },
                    }}

                    onCalendarToggled={calendarOpened => {
                      console.log(calendarOpened);
                    }}
                    hideArrows={true}
                    hideExtraDays={true}
                    renderHeader={date => {
                      <View></View>
                    }}
                    onDayPress={day => {
                      console.log('day pressed', day);
                    }}
                  />
                </View>
                <View>
                  <Text style={styles.calanderTitle}>All events on Sunday 18, January 2022</Text>
                </View>
                <BlurView intensity={40} tint="light" style={styles.eventListConatiner}>
                  <ScrollView style={{ height: 75 }} showsVerticalScrollIndicator={false}>
                    {
                      arr.map((e, i) => {
                        return (
                          <TouchableOpacity key={i} style={styles.eventList} onPress={() => navigation.navigate("EventWithTeam")}>
                            <View>
                              <Text style={styles.eventListTitle}>Jacob and Emma’s Wedding</Text>
                            </View>
                            <View style={styles.eventListBottomLine}>
                              <View>
                                <Image source={require("../../../Assets/Images/team.png")} style={styles.eventListBottomLineTeamImage} />
                              </View>
                              <View style={styles.eventListBottomLineCalandar}>
                                <FontAwesome name="calendar" size={18} color="white" />
                                <Text style={styles.eventListBottomLineCalandarText}>18 Jun</Text>
                              </View>
                              <View style={styles.eventListBottomLineCalandar}>
                                <Octicons name="location" size={18} color="white" />
                                <Text style={styles.eventListBottomLineCalandarText}>Location</Text>
                              </View>
                              <View>
                                <Text style={styles.eventListBottomLineCalandarText}>$50</Text>
                              </View>
                            </View>
                          </TouchableOpacity>
                        )
                      })
                    }
                  </ScrollView>
                  <ScrollView style={{ flex: 1 }} showsVerticalScrollIndicator={false}>
                    {
                      arr.map((e, i) => {
                        return (
                          <TouchableOpacity key={i} style={styles.eventList} onPress={() => navigation.navigate("SuggestionsApprove")}>
                            <View>
                              <Text style={styles.eventListTitle}>Jacob and Emma’s Wedding</Text>
                            </View>
                            <View style={styles.eventListBottomLine}>
                              <View>
                                <Image source={require("../../../Assets/Images/team.png")} style={styles.eventListBottomLineTeamImage} />
                              </View>
                              <View style={styles.eventListBottomLineCalandar}>
                                <FontAwesome name="calendar" size={18} color="white" />
                                <Text style={styles.eventListBottomLineCalandarText}>18 Jun</Text>
                              </View>
                              <View style={styles.eventListBottomLineCalandar}>
                                <Octicons name="location" size={18} color="white" />
                                <Text style={styles.eventListBottomLineCalandarText}>Location</Text>
                              </View>
                              <View>
                                <Text style={styles.eventListBottomLineCalandarText}>$50</Text>
                              </View>
                            </View>
                          </TouchableOpacity>
                        )
                      })
                    }
                  </ScrollView>
                </BlurView>
              </View>
              :
              // List View 
              <View>
                <View>
                  <Text style={styles.calanderTitle}>All events on Sunday 18, January 2022</Text>
                </View>
                <BlurView intensity={40} tint="light" style={styles.eventListConatinerOnlyListView}>
                  <ScrollView style={{ flex: 1 }} showsVerticalScrollIndicator={false}>
                    {
                      arr.map((e, i) => {
                        return (
                          <TouchableOpacity key={i} style={styles.eventList} >
                            <View>
                              <Text style={styles.eventListTitle}>Jacob and Emma’s Wedding</Text>
                            </View>
                            <View style={styles.eventListBottomLine}>
                              <View>
                                <Image source={require("../../../Assets/Images/team.png")} style={styles.eventListBottomLineTeamImage} />
                              </View>
                              <View style={styles.eventListBottomLineCalandar}>
                                <FontAwesome name="calendar" size={18} color="white" />
                                <Text style={styles.eventListBottomLineCalandarText}>18 Jun</Text>
                              </View>
                              <View style={styles.eventListBottomLineCalandar}>
                                <Octicons name="location" size={18} color="white" />
                                <Text style={styles.eventListBottomLineCalandarText}>Location</Text>
                              </View>
                              <View>
                                <Text style={styles.eventListBottomLineCalandarText}>$50</Text>
                              </View>
                            </View>
                          </TouchableOpacity>
                        )
                      })
                    }
                  </ScrollView>
                </BlurView>
              </View>
          }


          <TouchableOpacity style={styles.createEventBtn}>
            <Text style={styles.createEventBtnText}>Create Event</Text>
          </TouchableOpacity>
        </ScrollView>
        <RBSheet
          animationType={"slide"}
          closeOnDragDown={true}
          dragFromTopOnly={true}
          onOpen={(e) => { console.log(e) }}
          ref={filterRef}
          height={200}
          openDuration={250}
          closeDuration={250}
          customStyles={{
            wrapper: {
              backgroundColor: "transparent"
            },
            draggableIcon: {
              marginTop: -10
            },
            container: {
              padding: 20
            }
          }}
        >
          <View>
            <View>
              <Text style={styles.filterBoxTitle}>Filter</Text>
            </View>
            <TouchableOpacity style={styles.listViewBtn} onPress={() => {
              setListView(true)
              filterRef.current.close()
            }}>
              <Text style={styles.listViewBtnText}>List View</Text>
            </TouchableOpacity>
            <TouchableOpacity style={styles.listViewBtn} onPress={() => {
              setListView(false)
              filterRef.current.close()
            }}>
              <Text style={styles.listViewBtnText}>Calendar View</Text>
            </TouchableOpacity>
          </View>
        </RBSheet>
      </View>
    </View >
  )
}

